import React from "react";
function Ranges(){
    return <>
        <select>
            <option value="10000" selected="select">below 10,000</option>
            <option value="9999">below 20,000</option>
            <option value="20000">below 30,000</option>
            <option value="2999">below 3,000</option>
            <option value="0">ALL</option>
        </select>
    
    </>
}
export default Ranges;
